Narrator

Serge was driving me towards the Grand National Assembly for today's historic vote. It was a big day.

SetRichPresenceData(Attending the Assembly vote on the Constitutional Changes, Grand National Assembly, Holsord); PlaySceneMusic(Master); WaitForMessage(Continue);

Narrator

Suddenly, I noticed Lucian emerge from the crowd of packed politicians in front of me. He looked relieved when he saw me.

AddConversant(Lucian Galade); WaitForMessage(Continue);

Narrator

We followed the crowd into the parliamentary hall. After we were inside, Lucian and I separated to take our assigned seats. I went up to the mezzanine overlooking the hall and sat down.

RemoveConversant(Lucian Galade); WaitForMessage(Continue);

Narrator

Some Assembly members immediately walked to the ballot box to cast their votes. Most of them, however, began to congregate in groups around the hall, discussing the changes.

RemoveConversant(Gloria Tory); WaitForMessage(Continue);

Narrator

We waited for Serge by the entrance.

UnlockSteamAchievement(Game_1Vote); WaitForMessage(Continue);

Narrator

We both went back to our seats. When I returned back to the mezzanine, I saw Petr sitting in the chair next to mine.

RemoveConversant(Gloria Tory); RemoveConversant(Lucian Galade); RemoveConversant(Albin Clavin); AddConversant(Petr Vectern); WaitForMessage(Continue);

Narrator

The Assembly roared with all kinds of different reactions.

RemoveConversant(Gloria Tory); WaitForMessage(Continue);

Narrator

Then, I noticed Kesaro Kibener approaching.

AddConversant(Kesaro Kibener); WaitForMessage(Continue);

Narrator

He walked away.

RemoveConversant(Kesaro Kibener); WaitForMessage(Continue);

Narrator

As soon as I reached the bottom of the stairs, Kesaro Kibener approached me.

AddConversant(Kesaro Kibener); WaitForMessage(Continue);

Narrator

He turned his back and walked out the exit as two of his guards held the doors for him.

RemoveConversant(Tarquin Soll); WaitForMessage(Continue);

Narrator

He turned his back and walked out the exit as two of his guards held the doors for him.

RemoveConversant(Tarquin Soll); WaitForMessage(Continue);

Narrator

He looked at me.

AddConversant(Tarquin Soll); WaitForMessage(Continue);

Narrator

On my way, I bumped into Mansoun Leke.

AddConversant(Mansoun Leke); WaitForMessage(Continue);

Narrator

Suddenly, I noticed Tarquin Soll slowly rising from his seat at the back. He seemed to be struggling, and used his cane for help.

RemoveConversant(Frens Ricter); WaitForMessage(Continue);

Narrator

Albin Clavin and three other men approached us with envelopes in their hands.

AddConversant(Albin Clavin); WaitForMessage(Continue);

Narrator

I finally reached Lucian, by now deep in conversation with another member of our party. He excused himself and turned towards me.

RemoveConversant(Mansoun Leke); AddConversant(Lucian Galade); WaitForMessage(Continue);

Lucian Galade

"Mr. President. We may have a problem. Tarquin Soll is here."

PlaySceneMusic(Critical); WaitForMessage(Continue);

Narrator

The MPs kept shouting in the hall. Among them, I heard Frens Ricter's voice.

AddConversant(Frens Ricter); WaitForMessage(Continue);

Narrator

We waited for Serge by the entrance.

WaitForMessage(Continue);
